  02> CARGILL THOMPSON, Edmund Alwyn James
  b 08.08.1972
  Edmund read Theology at St John's College, Oxford and graduated BA(Oxon) in 1994.
  He spent a year as parish assistant at Christ Church, Highbury. He currently works
  as a tax accountant,
  02> WARREN, Martin Moutray m on 30.08.1958 to JAYNE, Elizabeth Valerie Lee
  b 12.03.1934
  b 26.10.1931
  Martin b. at Christchurch and m. at Magdalen College. Address: Totara Place, 388 Le Bons Bay Road, RD
  3, Akaroa, Banks Peninsula.
  Martin was educated at Christ's College, Magdalen College, Oxford, where he rowed for the College and
  graduated MA(Oxon) and DipTheol(Oxon). He trained for the Anglican Ministry at Westcott House,
  Cambridge. Lee qualified as a State Registered Nurse and a State Certified Midwife.
  Two months after their marriage, Martin was ordained by his father. He served curacies in Timaru and
  Upper Riccarton and was vicar of Geraldine (1963-68), vicar of Hornby in Christchurch (1968-85) and
  vicar of Akaroa-Banks Peninsula (1985-97). They have now retired to Le Bons Bay.
  Lee is breeding ponies and Martin is finishing a book he started working on in 1981. Since 1966 Martin
  has been extensively involved in the Charismatic Renewal within the Church. From 1983 to 1993 he was a
  member of the Standing Committee of the Diocese of Christchurch and served on a subcommittee which
  radically restructured the organisation of the Diocese to help the Church be more proactive in mission.
  From 1990 to 1997 he was a Canon of the Christchurch Cathedral and since 1990 he has served as a
  Trustee of the Henry and William Williams Memorial Trust.
  01> WARREN, Mark Aidan Temple m on ** **, 1986 to (1) LAWRENCE, Christine
  Rae
  b 31.08.1959
  b ** ** ****
  Christine, d/o Rodney Hayden Lawrence and Valerie Elizabeth McLaren. Divorced.
  01> WARREN, Emma Louise
  b 09.11.1988
  01> WARREN, Mark Aidan Temple and (2) FOX, Susan Alison
  b 31.08.1959
  b 20.11.1953
  Mark b. at Timaru. Susan, d/o Peter and Alison Fox of Foxdown, North Canterbury. Address: Waipari
  Station, RD 1, Waipawa.
  Mark was educated at Waihi Prep School and Christ's College and graduated DipAg from Lincoln
  University in 1981. On leaving school he worked on high country properties in the South Island,
  was a professional ski patroller in ski fields, and worked as a truck mechanic.
  Mark took over the management of Waipari Station in Central Hawkes Bay in 1984. In 1992 he was
  named Hawkes Bay Farmer of the Year, a Kellog Scholar, and was the subject of a Country Calendar TV
  programme on profitable hill country farming. In 1993 he was awarded the East Coast AC Cameron
  Memorial Award. He was Vice-President of Hawkes Bay Federated Farmers, and Meat and Wool Section
  Chairman (1993-95), and was heavily involved in negotiations on behalf of farmers during the time
  of the Weddel collapse. Together with Sue, he also owns and operates a four-wheel-drive training
  and adventure company, Hillseekers 4WD NZ Ltd, based mainly at Waipari. He is also employed on
  contract as 4WD adviser to Mazda NZ Ltd. This involves running 4WD training courses throughout the
  country for staff and clients, and advising on 4WD vehicles for the New Zealand market.
  Susan is a secondary school teacher specialising in chemistry, computers and science.
  (cont...).
